import React, { useState } from 'react';
import { View, Text, Image, TextInput, Pressable, StyleSheet, Dimensions } from 'react-native';
import { useNavigation, useRoute } from '@react-navigation/native';
import { Calendar } from 'react-native-calendars'; // Import the Calendar component

const { height: screenHeight, width: screenWidth } = Dimensions.get('window');

const HomePage = () => {
  const navigation = useNavigation();
  const route = useRoute();

  // Extract the fullName parameter from the route's params
  const fullName = route.params?.fullName;

  const [searchText, setSearchText] = useState('');
  const [selectedDates, setSelectedDates] = useState({}); // Initialize with an empty object

  const handleDateSelect = (day) => {
    const selectedDate = day.dateString;
    // Toggle the selected date in the state
    setSelectedDates((prevSelectedDates) => ({
      ...prevSelectedDates,
      [selectedDate]: {
        selected: !prevSelectedDates[selectedDate]?.selected,
      },
    }));
  };

  // Define the custom marking styles for specific days
  const customMarkedDates = {
    '2023-11-06': { customStyles: { container: { backgroundColor: '#FF9330' } } }, // Monday
    '2023-11-07': { customStyles: { container: { backgroundColor: '#FF9330' } } }, // Tuesday
    '2023-11-09': { customStyles: { container: { backgroundColor: '#FF9330' } } }, // Thursday
    '2023-11-08': { customStyles: { container: { backgroundColor: '#FF9330' } } }, // Wednesday
    '2023-11-10': { customStyles: { container: { backgroundColor: '#FF9330' } } }, // Friday
    '2023-11-11': { customStyles: { container: { backgroundColor: '#FF9330' } } }, // Saturday
    '2023-11-12': { customStyles: { container: { backgroundColor: '#FF9330' } } }, // Sunday
  };

  const handleSearch = () => {
    const searchLowerCase = searchText.toLowerCase();

    if (searchLowerCase.includes('vitamin')) {
      navigation.navigate('Vitamins');
    } else {
      navigation.navigate('MedicineDetails', { searchText });
    }
  };

  return (
    <View style={styles.container}>
      <View style={styles.upperHalf}>
        <Text style={styles.smallText}>Welcome {fullName}</Text>
        <Text style={styles.bigText}>Finding a perfect medicine?</Text>
        <View style={styles.searchContainer}>
          <TextInput
            style={styles.searchInput}
            placeholder="Search medicine ex. 'Biogesic'"
            onChangeText={setSearchText}
            value={searchText}
          />
          <Pressable onPress={handleSearch} style={styles.searchIcon}>
            <Image source={require('../assets/search.png')} style={styles.searchImage} />
          </Pressable>
        </View>
      </View>
      <View style={styles.lowerHalf}>
        <Text style={styles.categoriesText}>Categories</Text>
        <View style={styles.iconContainer}>
          <Pressable
            style={styles.icon}
            onPress={() => navigation.navigate('MedicineDetails', { searchText: 'Medicine' })}
          >
            <Image source={require('../assets/medicine.png')} style={styles.iconImage} />
            <Text style={styles.iconText}>Medicine</Text>
          </Pressable>
          <Pressable
            style={styles.icon}
            onPress={() => navigation.navigate('Vitamins')}
          >
            <Image source={require('../assets/vitamins.png')} style={styles.iconImage} />
            <Text style={styles.iconText}>Vitamins</Text>
          </Pressable>
          <Pressable
            style={styles.icon}
            onPress={() => navigation.navigate('MedicineComparer')}
          >
            <Image source={require('../assets/comparing.png')} style={styles.iconImage} />
            <Text style={styles.iconText}>Medicine Comparer</Text>
          </Pressable>
        </View>
        <View style={styles.calendarContainer}>
          <Calendar
            // Initially selected dates
            markedDates={{ ...selectedDates, ...customMarkedDates }}
            onDayPress={handleDateSelect} // Handle date selection
            theme={{
              calendarBackground: '#9AA9B1',
            }}
            style={{
              borderRadius: 20, // Set border radius to 20 for cube appearance
              width: screenWidth, // Match the screen width
            }}
          />
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#00F1C6',
  },
  upperHalf: {
    height: screenHeight * 0.4,
    flexDirection: 'column',
    alignItems: 'center',
    backgroundColor: '#6499E9',
    justifyContent: 'center',
    borderBottomRightRadius: 40,
    borderBottomLeftRadius: 40,
  },
  lowerHalf: {
    marginTop: 10,
    flex: 1,
    paddingHorizontal: 20,
  },
  smallText: {
    fontSize: 12,
    marginBottom: 10,
    position: 'relative',
    marginLeft: -200,
    color: 'white',
  },
  bigText: {
    fontSize: 40,
    marginBottom: 10,
    position: 'relative',
    color: 'white',
  },
  searchContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    backgroundColor: 'white',
    borderRadius: 25,
    paddingLeft: 4,
  },
  searchInput: {
    flex: 10,
    fontSize: 16,
    paddingVertical: 5,
  },
  searchIcon: {
    padding: 10,
  },
  searchImage: {
    width: 20,
    height: 20,
  },
  categoriesText: {
    fontSize: 18,
    fontWeight: 'bold',
  },
  iconContainer: {
    flexDirection: 'row',
    justifyContent: 'center',
    marginTop: 10,
  },
  icon: {
    alignItems: 'center',
    marginHorizontal: 10,
  },
  iconImage: {
    width: 60,
    height: 60,
    resizeMode: 'contain',
  },
  iconText: {
    marginTop: 5,
    fontSize: 14,
  },
  calendarContainer: {
    marginTop: 20,
    overflow: 'hidden', // Hide any overflow
  },
});

export default HomePage;
